import { Injectable } from '@angular/core';
import * as jsPDF from 'jspdf';

@Injectable()
export class PdfProvider {


  doc : any = null;
 //#region
  logo : string = "data:image/png;base64,"
  //#endregion
  //Rect Top right
  TopRectRightX : number = 220;
  TopRectRightY : number = 20;
  TopRectRightW : number = 200;
  TopRectRightH : number = 80;

  //BigRect
  BigRectX : number = 15;
  BigRectY : number = 110;
  BigRectW : number = 405;
  BigRectH : number = 500;

  PdfB64 : any = null;


  constructor() {
    
  }

  initPdf(){
    this.doc = new jsPDF('p','px','a4');
    this.doc.setFontSize(12);
    this.createSquelette();
  }

  addTopInfos(clientName : string, siteName : string){
    this.doc.addImage(this.logo, 'JPEG', 15, 10, 200, 90);
    this.doc.text(this.TopRectRightX+5, this.TopRectRightY+this.TopRectRightH/5-3, "Client : "+clientName);
    this.doc.text(this.TopRectRightX+5, this.TopRectRightY+(this.TopRectRightH/5)*2-3, "Site : "+siteName);
  }

  private createSquelette(){
    //Rect Top Right
    this.doc.rect(this.TopRectRightX,this.TopRectRightY,this.TopRectRightW,this.TopRectRightH);
    this.doc.setLineWidth(1);
    this.doc.line(this.TopRectRightX,this.TopRectRightY+this.TopRectRightH/5,this.TopRectRightX+this.TopRectRightW,this.TopRectRightY+this.TopRectRightH/5);
    this.doc.line(this.TopRectRightX,this.TopRectRightY+this.TopRectRightH/5*2,this.TopRectRightX+this.TopRectRightW,this.TopRectRightY+this.TopRectRightH/5*2);
    this.doc.line(this.TopRectRightX,this.TopRectRightY+this.TopRectRightH/5*3,this.TopRectRightX+this.TopRectRightW,this.TopRectRightY+this.TopRectRightH/5*3);
    this.doc.line(this.TopRectRightX,this.TopRectRightY+this.TopRectRightH/5*4,this.TopRectRightX+this.TopRectRightW,this.TopRectRightY+this.TopRectRightH/5*4);

    //Big Rect
    this.doc.rect(this.BigRectX,this.BigRectY,this.BigRectW,this.BigRectH);
    this.doc.line(this.BigRectX,this.BigRectY+16,this.BigRectX+this.BigRectW,this.BigRectY+16);
    this.doc.setLineWidth(10);
    this.doc.line(this.BigRectX,this.BigRectY+16*4,this.BigRectX+this.BigRectW,this.BigRectY+16*4);
    this.doc.line((this.BigRectX+this.BigRectW)/2,this.BigRectY+16,(this.BigRectX+this.BigRectW)/2,this.BigRectY+16*4);
    this.doc.setLineWidth(1);
    this.doc.line(this.BigRectX,this.BigRectY+16*6,this.BigRectX+this.BigRectW,this.BigRectY+16*6);
    this.doc.line(this.BigRectX,this.BigRectY+this.BigRectH-16*2,this.BigRectX+this.BigRectW,this.BigRectY+this.BigRectH-16*2);
    this.doc.line(this.BigRectX,this.BigRectY+this.BigRectH-16,this.BigRectX+this.BigRectW,this.BigRectY+this.BigRectH-16);
    this.doc.text(this.BigRectX+5, this.BigRectY+this.BigRectH-4, "nouvelle intervention  prvoir");
    this.doc.text(this.BigRectX+this.BigRectW/4*2, this.BigRectY+this.BigRectH-4, "oui");
    this.doc.text(this.BigRectX+this.BigRectW/4*3, this.BigRectY+this.BigRectH-4, "non");
    this.doc.circle(this.BigRectX+this.BigRectW/4*2+20, this.BigRectY+this.BigRectH-7, 5, 'S');
    this.doc.circle(this.BigRectX+this.BigRectW/4*3+25, this.BigRectY+this.BigRectH-7, 5, 'S');
  }

}
